The Extraordinary Nature of Water
Based on the theories of Viktor Schauberger
as interpreted by Callum Coats
parts 1 and 2, one hour, DVD


In this 2 part video you will be guided through forests, rivers, and the global water cycle, revealing insights into water\&amp;#039;s nature and how it needs to be handled by us to stay healthy. See the effects of nature\&amp;#039;s amazing vortex motion in water, how to harness clean abundant energy, and how to generate lightning from a fine water jet !

The video is based on Viktor Schauberger\&amp;#039;s brilliant work with natural energy and water, translated and written by Callum Coats in the books \&quot;Nature as Teacher\&quot;
( http://thepiratebay.se/details.php?id=3494268 ), \&quot;Living Energies\&quot; ( http://thepiratebay.se/details.php?id=3494267 ) and \&quot;The Water Wizard\&quot; ( http://thepiratebay.se/details.php?id=3494271 ).

Viktor (1885 to 1958) made a lifelong study of water, from mountain springs to river flows and highly evolved hydraulics. He earned the name \&quot;Water Wizard\&quot; by developing a deep understanding of water ... the most important life-giving and energy empowered substance on the planet.

